import React, { Component, Fragment } from "react";
import "../css/App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.props();
  }
  render() {
    return (
      <Fragment>
        <div>
          <ul>
            <li>1</li>
            <li>2</li>
            <li>3</li>
            <li>4</li>
            <li>5</li>
          </ul>
        </div>
      </Fragment>
    );
  }
}
export default App;
